import React from "react";
// import { Link } from "react-router-dom";
import "./style.css";

function Header() {
	return (
		<div>
			<div class='jumbotron jumbotron-fluid'>
				<div class='container'>
					<h1 class='display-4'>Google Books Search</h1>
					<p class='lead'>Search and save your favorite books!</p>
				</div>
			</div>
			<nav class='nav nav-pills flex-column flex-sm-row'>
				<a class='flex-sm-fill text-sm-center nav-link' href='/'>
					Search Books
				</a>
				<a class='flex-sm-fill text-sm-center nav-link' href='/saved'>
					Saved Books
				</a>
			</nav>
		</div>
	);
}

export default Header;
